import "./App.css";
import { faC, faCoffee } from '@fortawesome/free-solid-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

function Card() {
  const btn = <FontAwesomeIcon icon={faCoffee} />
  return (
    <div className="Card">
      <p class="text">
        <FontAwesomeIcon icon={faCoffee}/>
      </p>
    </div>
  );
}

export default Card;
